import React from 'react';
import { NavLink } from 'react-router-dom';
import { Paper } from '@mui/material';

import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

export default function App() {
   return (
      <Paper className='main-nav'>
         <span>Page Logo here!</span>
         <span>
            <NavLink className='main-navlink' to='/'>Home Page</NavLink>
            <NavLink className='main-navlink' to='/about'>About Page</NavLink>
            <NavLink className='main-navlink' to='/resorts'>Resorts Page</NavLink>
         </span>
      </Paper>

   )
};
